import { FC } from 'react';
import Link from 'next/link';
import { StarFilled } from '@ant-design/icons';

interface P {
  login: string;
  name: string;
  full_name: string;
  description: string;
  license: Object;
  updated_at: Date;
  open_issues_count: number;
  language: string;
  stargazers_count: number;
}

const Repo: FC<P> = (repo) => {
  const {
    login,
    name,
    full_name,
    description,
    license,
    updated_at,
    open_issues_count,
    language,
    stargazers_count,
  } = repo;
  return (
    <div>
      <div className="repo-info">
        <h3 className="repo-title">
          <Link href={`/detail?owner=${login}&name=${name}`}>
            <a>{full_name}</a>
          </Link>
        </h3>
        <p className="repo-desc">{description}</p>
        <p className="other-info">
          <span className="license">{license}</span>
          <span className="last-updated">{updated_at}</span>
          <span className="open-issues">{open_issues_count}</span>
        </p>
      </div>
      <div className="lang-star">
        <span className="lang">{language}</span>
        <span className="stars">
          {stargazers_count}
          <StarFilled />
        </span>
      </div>
    </div>
  );
};

export default Repo;
